import styles from './padrao.module.css';
import Estoque from './estoque';
import Grafico from '../components/sidebar';
import React from "react";
import Menu from '../components/menu';
import { Routes, Route, Outlet } from 'react-router-dom';
import Alterar from './alterar';
import Cadastrar from './cadastrar';
import Config from './config';


export default function Home() {
    return (
        <>
            <Menu />
            <div className={styles.allhome}>
            <div className={styles.sidebar}>
                <Grafico />
            </div>
            <div className={styles.center}>
            <Routes>
                    <Route index element={<Estoque />} />
                    <Route path="config" element={<Config />} />
                    <Route path="homcadastrar" element={<Cadastrar />} />
                    <Route path="alterar/:id" element={<Alterar />} />
                    <Route path="estoque" element={<Estoque />} />
                </Routes>
                <Outlet />
            </div>

        </div>
        </>
    );
}
